	add("birth", "{\"term\":\"birth\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old norse\", \"old frisian\"], \"text\":\"{{PIE root|en|bʰer}}From Middle english (1100-1500) \u0027birthe\u0027 (1250), from earlier \u0027burthe\u0027 \u0027burde\u0027 \u0026lt;ref\u0026gt;Robert K. Barnhart, ed., \u0027Chambers Dictionary of Etymology\u0027 (1988; reprint, Edinburgh: Chambers, 2008), 95.\u0026lt;/ref\u0026gt; from Old norse \u0027burðr\u0027 \u0027byrd\u0027 lt;ref\u0026gt;Richard Cleasby and Gudbrand Vigfusson\u0027s \u0027\u00271874\u0027\u0027 Icelandic-English dictionary.\u0026lt;/ref\u0026gt; (Old Swedish \u0027byrth\u0027 Swedish \u0027börd\u0027 , replacing Old english (ca. 450-1100) \u0027gebyrd\u0027 (rare variant \u0027byrþ\u0027 \u0026lt;ref\u0026gt;Joseph Bosworth and T. Northcote Toller\u0027s \u0027\u00271898\u0027\u0027 Anglo-Saxon dictionary.\u0026lt;/ref\u0026gt;. The Old Norse is from Proto-germanic {{m|gem-pro|*burdiz}} (compare Old frisian \u0027berde\u0027 \u0027berd\u0027 ; Old English {{m|ang|gebyrd}} is from prefixed {{m|gem-pro|*gaburdiz}} (compare Dutch \u0027geboorte\u0027 German \u0027geburt\u0027 , from Proto-indo-european {{m|ine-pro|*bʰr̥tis}} (compare Latin \u0027fors|lang\u003dla\u0027 () Old Irish \u0027brith\u0027 , from {{m|ine-pro|*bʰer-}} ‘to carry, bear’. More at {{l|en|bear}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of childbearing; the beginning of life\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An instance of childbirth\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Intersex babies account for roughly one per cent of all \u0027\u0027births\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A beginning or start; a point of origin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027birth\u0027\u0027 of an empire\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The circumstances of one\u0027s background, ancestry, or upbringing\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He was of noble \u0027\u0027birth\u0027\u0027, but fortune had not favored him\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Prescot\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"elected without reference to \u0027\u0027birth\u0027\u0027, but solely for qualification\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"That which is born\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Ben Jonso\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Poets are far rarer \u0027\u0027births\u0027\u0027 than kings\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Addiso\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Others hatch their eggs and tend the \u0027\u0027birth\u0027\u0027 till it is able to shift for itself\", \"priority\":14}]}, \"synonyms\":{}}");

	add("birthday", "{\"term\":\"birthday\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The anniversary of the day on which someone is born\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1867\u0027\u0027, w:Charles Charles Dickens, \u0027s:Oliver Twist/Chapter Oliver Twist\u0027, Chapter 2: Treats Of Oliver Twist\u0027s Growth, Education, And Board\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Oliver Twist\u0027s ninth \u0027\u0027birthday\u0027\u0027 found him a pale thin child, somewhat diminutive in stature, and decidedly small in circumference\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1903\u0027\u0027, w:L. Frank L. Frank Baum, \u0027s:The Surprising Adventures of the Magical Monarch of Mo and His People/Chapter The Surprising Adventures of the Magical Monarch of Mo and His People\u0027, The Fifth Surprise: The Monarch Celebrates His \u0027\u0027Birthday\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One of the Wise Men said the King was born in February; another declared it was in May, and a third figured the great event happened in October. So the King issued a royal decree that he should have three \u0027\u0027birthdays\u0027\u0027 every year, in order to be on the safe side; and whenever he happened to think of it he put in an odd \u0027\u0027birthday\u0027\u0027 or two for luck\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1906\u0027\u0027, w:Edith Edith Nesbit, \u0027s:The Railway Children/Chapter The Railway Children\u0027, Chapter 9: The pride of Perks\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;And we thought we\u0027d make a nice \u0027\u0027birthday\u0027\u0027 for him. He\u0027s been so awfully jolly decent to us, you know, Mother,\u0026quot; said Peter, \u0026quot;and we agreed that next bun-day we\u0027d ask you if we could.\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"w:Cotton Cotton Mather, w:Worthington Chauncey Worthington Chauncey Ford (editor), \u0027Diary of Cotton Mather\u0027, Volume 1: 1681-1708, footnote, birthdays%22\u0026amp;hl\u003den\u0026amp;ei\u003d1exYTre8OayHmQXxqdyjDA\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;ved\u003d0CEYQ6AEwA\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"birthdays%22\u0026amp;f\u003dfalse page 1\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"It was his custom to begin a new year\u0027s record on February 12, his \u0027\u0027birthday\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1921\u0027\u0027 June 4, \u0027s:The Times/1921/News/Birthday Honours — Companions of Birthday Honours — Companions of Honour\u0027, in \u0027w:The The Times\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The King\u0027s \u0027\u0027Birthday\u0027\u0027, which occurred yesterday, will be officially observed to-day, and the customary list of honours conferred on the occasion is published\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The anniversary of the day on which something is created\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The date on which someone is born or something is created, more commonly called \u0027\u0027birthdate\u0027\u0027 or \u0027\u0027date of birth\u0027\u0027.\u0026lt;!--This is not an abbreviation of \u0026quot;birthday\u0026quot;: abbreviation: DOB (\u0027date of birth.\u0027)--\u0026gt\", \"priority\":14}]}, \"synonyms\":{}}");

